import React from 'react';

function Nav(props) {
    return (
        <div style={{ height: '151px', background: '#FFFFFF', boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)' }}>
            <h2>I'm a nav</h2>
            <p>Ignore me. I'm not important. I'm cool, though.</p>
        </div>
    );
}

export default Nav;
